1. Mount or burn image 
2. Install 
3. Run the exe from the UPDATE folder on the DVD, for installing pre-order DLC. 
Remember to check installation folder, as it does not auto locate it. Just a reminder ;) 
4. Copy everything from the SKIDROW folder into the game installation 
5. Play the game 
